export const SET_USER_RECIPE_NEW_DATA = 'SET_USER_RECIPE_NEW_DATA';

export const setUserRecipeNewDataReducer = (data) => ({
    type: SET_USER_RECIPE_NEW_DATA,
    payload: data,
})
